      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
  ];

const AvailableMeals =()=>{

const MealsArr = DUMMY_MEALS.map(meals=>{<li>{meals.name}</li>});


    return(
        <section className={classes.meals}>
            <ul>
{MealsArr}
        </ul>
        </section>

    )

};
 export default AvailableMeals;
